import styled from "styled-components";

export const Container = styled.section`
  position: fixed;
  bottom: 0;
  left: 0;
  min-height: 80vh;
  max-width: 100%;
  z-index: 0;
  background: #121212;

  color: #fff;
  display: flex;
  flex-direction: column;
  justify-content: center;

  margin: 0 7.5vw;

  h2 {
    text-transform: uppercase;
  }
`;
